At less than a year old, Winston is one of the most well-rounded dogs. We simply can&rsquo;t imagine him giving his last owners a problem to put him in the shelter because he is such a great dog.&nbsp;



Winston is amazing with other dogs on and off the leash, great with kids, and walks nicely on a leash. He knows basic commands such as sit, down, and paw.&nbsp;


&nbsp;


He is house trained and would make a great addition to any family.&nbsp;


&nbsp;


Apply for Winston at&nbsp;https://www.muttsinneed.org/adoption-application.html
